import React from 'react';
import {
  Button,
  Card,
  CardBody,
  CardFooter,
  CardTitle,
  Form,
  FormGroup,
  Input,
} from 'reactstrap';
import './style.css';
import { Link } from 'react-router-dom';

const ComingSoon = () => {
  return (
      <div>
        <Card className="text-center" style={{width:'24rem', margin:'auto', marginTop:'5%'}}>
            Apa ini
        </Card>
      </div>
  )
};

export default ComingSoon;
